import React from 'react';
import "./App.css";
const Recipe = ({title, calories, image}) => {
    return(
        <div className="recipeItem">
            <h1>{title}</h1>
            <p><h2>calories(KJ):</h2>{calories}</p>
            <img src={image}  alt="" height="150" width="150"/>
        </div>
    );
};

export default Recipe;
